export const ADD_ASSET = "ADD_ASSET";

export const requestDropDownOptions = (assetID) => ({ 
    type: REQUEST_DROP_DOWN_OPTIONS, assetID
});

export const receiveDropDownOptions = (assetData) => ({
     type: RECEIVE_DROP_DOWN_OPTIONS, assetData
